  const display = useSelector((state) => state.booking.visibility)

    return(
      <div className='no_booking'>
        <h2>Освободить место</h2>
        <form action="">
          <Button text='Да'/>
          <Button text='Нет'/>
        </form>
      </div>
    )
}

export default FormNoBooking;
